import React from 'react';

function AssetSubForm(props) {
    if(props.asset_type == 'House') {
        return(
            <div>
                <h4>
                    {props.asset_type}
                </h4>
                <div className="my-2">
                    Address
                </div>
                <div class="input-group mb-3">
                    <span class="input-group-text" id="door_numbers">No.</span>
                    <input type="text" class="form-control" placeholder="Door Number"  id="door_number"  name="door_number" aria-label="Door Number" aria-describedby="basic-addon1" onChange={props.func.handleChange} onBlur={props.func.handleBlur} value={props.func.values.door_number} />
                </div>
            </div>
        );
    } else if(props.asset_type == 'Appartment') {
        return(
            <div>
                <h4>
                    {props.asset_type}
                </h4>
                <div>

                </div>
            </div>
        );
    } else if(props.asset_type == 'Store') {
        return(
            <div>
                <h4>
                    {props.asset_type}
                </h4>
            </div>
        );
    } else if(props.asset_type == 'Koddon') {
        return(
            <div>
                <h4>
                    {props.asset_type}
                </h4>
            </div>
        );
    } else if(props.asset_type == 'Land') {
        return(
            <div>
                <h4>
                    {props.asset_type}
                </h4>
            </div>
        );
    }
}

export default AssetSubForm;
